import React from 'react';
import logo from '../images/logo_est_dados_2.png';
import LDDE from '../images/LDDE.png';
import F_CIRC from '../images/FILA_CIRCULAR.png';
import HEAP from '../images/HEAP.png';
import './pgInicial.css';




function pgInicial() {
    return ( 
        <div className = "inicial" >
            <header className = "inicial-header" >
                <p className = "title" > CC4652 - ESTRUTURA DE DADOS </p> 
                <img src = {logo} className = "inicial-logo" alt = "logo" / >
                <p className = "selOpcao" >
                Selecione a estrutura desejada </p>
                <div className = "opcoes" >
                    <div className = "menu" >
                        <img src = { LDDE } alt = "LDDE" / >
                        <div>
                            <a href = "/LDDE" > <p> LDDE </p></a> 
                        </div>     
                    </div>
                    <div className = "menu" >
                    <img src = { F_CIRC }alt = "FILA CIRCULAR"/ >
                    <a href = "/FILA_CIRC" ><p> FILA CIRCULAR </p></a > 
                    </div>
                    <div className = "menu" >
                        <img src = { HEAP }alt = "HEAP" / >
                        <a href = "/HEAPS" > <p> HEAPS </p></a >
                    </div>
                </div> 
            </header > 
        </div>
    );
}

export default pgInicial;
